function SideBar(props) {

  const click = (e) =>{
    props.hideShow(e.currentTarget.id);
  }

  return (
    <div className="sidebar">
          <button id='dragdrop' onClick={click} className="buttons">Drag Drop</button>
          <button id='forms' onClick={click}  className="buttons">Forms</button>
          <button id='redux' onClick={click}  className="buttons">Redux</button>
          <button id='api' onClick={click}  className="buttons">API</button>
          <button id='grid' onClick={click}  className="buttons">Grid</button>
          <button id='context' onClick={click}  className="buttons">Context</button>
    </div>
  );
}

export default SideBar;
